import React from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Welcome from "./screens/welcome/welcome";
import PlayerInfo from "./screens/player-info/player-info";
import AccountRegister from "./screens/account-register";

function App() {
  return (
      <BrowserRouter>
          <div className="grid-container">
              <Switch>
                  <div className="App">
                      <Route path="/" exact={true} component={Welcome}/>
                  </div>
                  <div>
                      <Route path="/info" component={PlayerInfo}/>
                  </div>
                  <div>
                      <Route path="/account-type-register" component={AccountRegister} />
                  </div>
              </Switch>
          </div>
      </BrowserRouter>


  );
}

export default App;
